// reducers/datasetReducer.js
const initialState = {
    datasetList: [],
    datasetMapList: []
};

const datasetReducer = (state = initialState, action) => {
    switch (action.type) {
        case 'UPDATE_DATASET_LIST':
            return {
                ...state,
                datasetList: action.payload
            };
        case 'UPDATE_DATASET_MAP_LIST':
            return {
                ...state,
                datasetMapList: action.payload
            };
        default:
            return state;
    }
};

export default datasetReducer;
